import React, {Component} from 'react';


class App extends Component {
  state = {
    todos: [
      {
        id: 1, 
        content: "Buy Milk"
      },
      {
        id: 2, 
        content: "Buy food"
      }
    ]
  }
  render(){
    return(
      <div className="todo-app">
        <h1 center>This is My ToDO App</h1>
      </div>
    );
  }
}

export default App;
